pragma solidity ^0.6.0;

import "./Ownable.sol";
import "./SafeMath.sol";
import "./Token.sol";
import "./ERC20Interface.sol";


interface minter{
    
   
    function acceptMintingOwnerShip() external returns (bool);
    function mintToken(uint256 _amount) external returns (bool);
    function transferMintingOwnerShip(address _whom) external returns (bool);
}




contract StackStrorage {
    
    uint256 public constant PERCENT_NOMINATOR = 10**6;
    uint256 public constant DECIMAL_NOMINATOR = 10**18;
    
    uint256 public  currentStackId =1;
    
    
    /**
     * @dev check if token is listed 
    **/
    mapping(address => bool) public listedToken;
    
    /**
     * @dev list of tokens
    **/
    address[] public tokens;
    
    /**
     * @dev check if token is listed 
    **/
    mapping(address => uint256) public totalTokens;
    
    /**
     * @dev token roundId 
    **/
    mapping(address => uint256) public tokenRoundId;
    
    
    mapping(address => mapping(address => uint256)) public stackBalance;
    
    
    mapping(address => mapping(address => uint256)) public lastStackClaimed;
    
    
    mapping (address => mapping(uint256 =>uint256)) public dayWiseRatio;
    
    
    mapping (address => uint256) public annualMintPercentage;

    
    
    /**
     * @dev roundWise user tokens  
    **/
    mapping(address => mapping(address => mapping(uint256 => uint256))) public roundWiseToken;
    
    /**
     * @dev check if address is in paynode
     **/
    mapping(address => mapping(address => bool)) public isPayNoder;
    

    /**
     * @dev maintain array index for address
     **/
    mapping(address => mapping(address => uint256)) public payNoderIndex;
    
     /**
     * @dev to retrieve paynode according to token
     **/
     mapping(address => address)public tokenPayNode;
    
    event Stack(
        uint256 indexed _roundId,
        address indexed _token,
        address indexed _whom,
        uint256 _amount
    );
    
    event StackClaimed(
        uint256 indexed _roundId,
        address indexed _whom,
        uint256 _amount
    );

    event UnStack(
        uint256 indexed _roundId,
        address indexed _whom,
        uint256 _amount
    );
    
    event Data(bool);
    
}

abstract contract Paynodes is Ownable,SafeMath,Token,StackStrorage{
    
     /**
     * @dev check if address is in paynode
   

    /**
     * @dev list of paynoder
     **/
    address[2][] public payNoders;

    /**
     * @dev maximum paynoder 
    **/
    uint256 public payNoderSlot = 10;
    
    /**
     * @dev minimum balance require for be in paynode
    **/
    uint256 public minimumBalance = 4500 ether;
    
    /**
     * @dev divide by 100 to achive into fraction
     * it is mulitply
    **/
    uint256 public extraMintForPayNodes = 5000;
    
    
    
    /**
     * @dev adding account in paynode 
    **/
    function addaccountToPayNode(address _token,address _whom)
        external
        onlyOwner()
        returns (bool)
    {   
        require(payNoders.length <= payNoderSlot ,"ERR_PAYNODE_LIST_FULL");
        require(balances[_whom] >= minimumBalance,"ERR_PAYNODE_MINIMUM_BALANCE");
        require(isPayNoder[_token][_whom] == false,"ERR_ALREADY_IN_PAYNODE_LIST");
        isPayNoder[_token][_whom] = true;
        payNoderIndex[_token][_whom] = payNoders.length;
        payNoders.push([_token,_whom]);
        tokenPayNode[_token] = _whom;
        return true;
    }
    

    /**
     * @dev remove account from paynode
     **/
    function _removeaccountToPayNode(address _token,address _whom) internal returns (bool) {
        require(isPayNoder[_token][_whom], ERR_AUTHORIZED_ADDRESS_ONLY);
        uint256  _payNoderIndex = payNoderIndex[_token][_whom];
      
        address[2] memory _lastAddress = payNoders[safeSub(payNoders.length,1)];
        payNoders[_payNoderIndex] =_lastAddress ;
        payNoderIndex[_token][_lastAddress[1]] = _payNoderIndex;
        delete isPayNoder[_token][_whom];
        payNoders.pop();
        return true;
    }

    /**
     * @dev remove account from paynode
     **/
    function removeaccountToPayNode(address _token,address _whom)
        external
        onlyOwner()
        returns (bool)
    {
        return _removeaccountToPayNode(_token,_whom);
    }

    /**
     * @dev owner can change minimum balance requirement
     **/
    function setMinimumBalanceForPayNoder(uint256 _minimumBalance)
        external
        onlyOwner()
        returns (bool)
    {
        minimumBalance = _minimumBalance;
        return true;
    }

    /**
     * @dev owner can change extra mint percent for paynoder
     * _extraMintForPayNodes is set in percent with mulitply 100
     * if owner want to set 1.25% then value is 125
     **/
    function setExtraMintingForNodes(uint256 _extraMintForPayNodes)
        external
        onlyOwner()
        returns (bool)
    {
        extraMintForPayNodes = _extraMintForPayNodes;
        return true;
    }

    /**
     * @dev owner can set paynoder slots
     **/
    function setPayNoderSlot(uint256 _payNoderSlot)
        external
        onlyOwner()
        returns (bool)
    {
        payNoderSlot = _payNoderSlot;
        return true;
    }


}


contract staking is Paynodes {
    
    constructor(address[] memory _token) public {
        for(uint8 i = 0; i < _token.length; i++){
            listedToken[_token[i]] = true;
          
            tokens.push(_token[i]);
        }
    }
    
    
    function stackToken(address _token,uint256 _amount) internal returns(bool){
        
        require(listedToken[_token],"ERR_TOKEN_IS_NOT_LISTED");
        
        totalTokens[_token] = safeAdd(totalTokens[_token], _amount);
    
       
        ERC20Interface(_token).transferFrom(msg.sender,address(this),_amount);
        
         tokenRoundId[_token]=safeAdd(tokenRoundId[_token],1);
         uint256 _tokenRoundId = tokenRoundId[_token];
        
        roundWiseToken[_token][msg.sender][_tokenRoundId] = safeAdd(
            roundWiseToken[_token][msg.sender][_tokenRoundId],
            _amount 
        );
        
        stackBalance[_token][msg.sender] = safeAdd(stackBalance[_token][msg.sender], _amount );
        
        if (lastStackClaimed[_token][msg.sender] == 0) {
            lastStackClaimed[_token][msg.sender] = _tokenRoundId;
        }
        emit Stack(_tokenRoundId,_token, msg.sender, _amount );
        return true;
    }
    
    
    function stackTokenBatch(address[] calldata _token,uint256[] calldata _amount) external returns(bool){
        
            for(uint i=0;i<_token.length;i++)
            {
                
              stackToken(_token[i],_amount[i]);
            }
          return true;
        
    
    }
    
    /**
     * @dev stackign started each month by owner
     **/
    function startStacking(address _token) external onlyOwner() returns (uint256) {
        require(totalTokens[_token] > 0,"ERR_NO_STACKING");
        uint256 stackAmount = safeDiv(
            safeMul(totalTokens[_token], annualMintPercentage[_token]),
            120000
        );
        minter(_token).mintToken(stackAmount);
        uint256 ratio = safeDiv(
                safeMul(stackAmount, safeMul(DECIMAL_NOMINATOR, PERCENT_NOMINATOR)),
                totalTokens[_token]
            );
        totalTokens[_token] = safeAdd(totalTokens[_token], stackAmount);
        dayWiseRatio[_token][currentStackId] = ratio;
        currentStackId = safeAdd(currentStackId, 1);
        return currentStackId;
    } 
    

    
    function _calculateStack(address _token,address _whom) internal view returns (uint256) {
        uint256 _lastRound = lastStackClaimed[_token][_whom];
        uint256 token;
        uint256 _stackToken = 0;
        if (_lastRound > 0) {
            for (uint256 x = _lastRound; x < currentStackId; x++) {
                token = safeAdd(token, roundWiseToken[_token][_whom][x]);

                uint256 _tempStack = safeDiv(
                    safeMul(dayWiseRatio[_token][x], token),
                    safeMul(DECIMAL_NOMINATOR, PERCENT_NOMINATOR)
                );
                _stackToken = safeAdd(_stackToken, _tempStack);
                 token = safeAdd(token, _tempStack);
            }
        }
        return _stackToken;
    }
    
    // show stack balance with what user get
    function getStackBalance(address _token,address _whom) external view returns (uint256) {
        uint256 _stackToken = _calculateStack(_token,_whom);
        return safeAdd(stackBalance[_token][_whom], _stackToken);
    }
    
    // claim only rewards
    function claimOnlyRewards(address _token) external returns (bool) {
        uint256 reward = _calculateStack(_token,msg.sender);
        ERC20Interface(_token).transfer(msg.sender,reward);
        totalTokens[_token] = safeSub(totalTokens[_token], reward);
        lastStackClaimed[_token][msg.sender] = currentStackId;
        emit StackClaimed(currentStackId,msg.sender,reward);
        return true;
    }
    
    // unlocking stack token
    function unlockTokenFromStack(address _token) external returns (bool) {
        require(totalTokens[_token] > 0,"ERR_NO_UNSTAKE");
        uint256 reward = _calculateStack(_token,msg.sender);
        uint256 actulToken = safeAdd(stackBalance[_token][msg.sender], reward);
        ERC20Interface(_token).transfer(msg.sender,actulToken);
        totalTokens[_token] = safeSub(totalTokens[_token], actulToken);
        stackBalance[_token][msg.sender] = 0;
        lastStackClaimed[_token][msg.sender] = 0;
        emit UnStack(currentStackId, msg.sender, actulToken);
        return true;
    }
    
    // _percent should be mulitply by 100
    function setAnnualMintPercentage(address _token,uint256 _percent) external returns (bool) {
        annualMintPercentage[_token] = _percent;
    }
    
    //accepting Minting OwnerShip
    function acceptMintingOwnerShip() external onlyOwner() returns(bool){
        newMintingOwner = address(this);
        return true;
    }
    
    function availabletokens()public view returns(uint){
        return tokens.length;
    }
       
      
  
}

